function Links(props){
    const links = []
    for(const tab of ["Home", "Gnome"]){
        links.push(
            <button key={tab} onClick={() => {props.changeTab(tab)}}>{tab}</button>
        )
    }
    return (
        <div>
            {links}
        </div>
    )
}
